import React from "react";
import ContentRowMovies from "./ContentRowMovies";
import TopBar from './TopBar';


function ContentWrapper() {
    return(
        <div class='contentWrapper'>
            <TopBar/>
            <h1>App Dashboard</h1>
            <ContentRowMovies/>
        </div>
    )
}

export default ContentWrapper
